import React, {Component} from 'react';
import './styles/Leaderboard.css';


class Marketplace extends Component {
	constructor(props){
		super(props);
		this.state = {
		item: []
		}
	}

	componentDidlMount(){
		fetch('/api/item')
		.then(data => data.json())
		.then(lot => this.setState({lot}));
	}

	render(){
		return(
			<div>
				<div class="leaderboard">
					<ul class="">
						<li class="userRow">
							<span class="rank">1</span>
							<div class="userImage"></div>
							<div class="username">ExamplePlayer1</div>
						</li>
						<li class="userRow">
							<div class="userImage"></div>
							<div class="username">ExamplePlayer1</div>
						</li>
						<li class="userRow">
							<div class="userImage"></div>
							<div class="username">ExamplePlayer1</div>
						</li>
						<li class="userRow">
							<div class="userImage"></div>
							<div class="username">ExamplePlayer1</div>
						</li>
						<li class="userRow">
							<div class="userImage"></div>
							<div class="username">ExamplePlayer1</div>
						</li>
					</ul>
				</div>
			</div>
		)
	}
}
export default Marketplace;
